import React, { Component } from 'react';
import {
    Grid,
    Typography
} from "@material-ui/core"; 

const Contact = () => {
    return (
        <Grid container direction="column" justify="center" alignItems="center">
            <Box mb={2}>
                <Typography variant="h2">Contact</Typography>
            </Box>
        </Grid>
    );
}

export default Contact;
